import React, {Component} from 'react';

class Header extends Component
{
    render() {
        return (
            <>
                <header className="header">
                    <div className="container">
                        <div className="header-logo">

                        </div>
                        <div className="header-user">

                        </div>
                    </div>
                </header>
            </>
        )
    }
}

export default Header;
